import Layout from "../layout";

function Cart() {
  return (
    <Layout>
      <div className="flex gap-10 w-3/5 pt-10 m-auto">
        <div>
          <h3>Bag</h3>
        </div>
        <div>
          <h3>Summary</h3>
        </div>
      </div>
    </Layout>
  );
}

export default Cart;
